import Container from "react-bootstrap/Container";
import {data} from "../helpers/data"
import PlayerCard from "./PlayerCard";

const CardContainer = () => {
  return (
    <Container className="card-container rounded-4 my-4 p-3">
        <Row>
            <Col>
            {data.map((player)=> (
            <PlayerCard {...player}/>
        ))}
            </Col>
        </Row>

    </Container>
  )
}

export default CardContainer
